import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

ReactDOM.render(
  <>
    <p> These are my friends </p>
    <ol>
      <li> Shreyas </li>
      <li> Anushka  </li>
      <li> Sumeet </li>
    </ol>
  </>,
  document.getElementById("root")
);
